import { makeStyles } from '@material-ui/core';

const styles = makeStyles(theme => ({
  toolbarTop: {
    background: '#00ACC1'
  },
  tollbarBottom: {
    minHeight: 0,
    height: 40,
    background: 'white'
  },
  subMenuItem: {
    color: '#547191'
  },
  menuItem: {
    padding: '0px 10px'
  },
  icon: {
    color: 'white'
  }
}));

export default styles;
